<template>
  <transition name='el-zoom-in-bottom'>
    <div class='su-viewer-modal' @click='handleClick' v-if='show'>
      <z-viewer :data='data' :height='height' :autoplay='false' type='' />
      <div class='close' @click='close'>
        <svg t='1635900759666' class='icon' viewBox='0 0 1024 1024' version='1.1' xmlns='http://www.w3.org/2000/svg' p-id='2406' width='32' height='32'>
          <path
            d='M649.179 512l212.839-212.84c37.881-37.881 37.881-99.298 0-137.179s-99.298-37.881-137.179 0L512 374.821l-212.839-212.84c-37.881-37.881-99.298-37.881-137.179 0s-37.881 99.298 0 137.179L374.821 512 161.982 724.84c-37.881 37.881-37.881 99.297 0 137.179 18.94 18.94 43.765 28.41 68.589 28.41 24.825 0 49.649-9.47 68.589-28.41L512 649.179l212.839 212.84c18.94 18.94 43.765 28.41 68.589 28.41s49.649-9.47 68.59-28.41c37.881-37.882 37.881-99.298 0-137.179L649.179 512z'
            p-id='2407' fill='#ffffff'></path>
        </svg>
      </div>
    </div>
  </transition>
</template>

<script>
import ZViewer from "../z-viewer";

export default {
  name: 'z-viewer-model',
  components:{ZViewer},
  data() {
    const height = document.body.clientHeight + 'px'
    // const CLOSE_BASE64 = 'data:image/png;base64,'

    return {
      data: [],
      height,
      show: false,
      // CLOSE_BASE64,
    }
  },
  methods: {
    close() {
      this.show = false
      document.removeEventListener('keydown', this.handleKeyDown)
      // const wrapper = document.querySelector('.su-viewer-modal')
      // console.log(wrapper)
      // if (wrapper) {
      //   setTimeout(() => document.querySelector('body').removeChild(wrapper), 1000)
      // }
    },
    handleClick() {
      this.close()
    },
    handleKeyDown(e) {
      e.stopPropagation()
      if (e.keyCode === 27) {
        this.close()
      }
    },
  },
  mounted() {
    document.addEventListener('keydown', this.handleKeyDown)
  },
}
</script>
